import React, { useState, useEffect } from 'react';
import './materials.css'; // CSS file for styling

const PackagingMaterials = () => {
  // Sample initial data (this can be fetched from an API)
  const initialData = [
    {
      id: '001',
      material: 'Manilla Pocket Gummed Envelope',
      internalMeasurement: '24.1 x 31.8 cm',
      weightLimit: '500g',
      description: 'The special GreenMart Envelope rate only applies up to this weight.',
      lastModified: '27-July-24 09:00',
    },
    {
      id: '002',
      material: 'Square bottom paper bag',
      internalMeasurement: 'Small: 20cm x 10cm x 25cm, Medium: 30cm x 15cm x 35cm, Large: 40cm x 20cm x 45cm',
      weightLimit: '1kg',
      description: 'We customize size according to customer preferences and product size.',
      lastModified: '27-July-24 09:00',
    },
    // Add more data entries here...
  ];

  const [materials, setMaterials] = useState(initialData);
  const [editIndex, setEditIndex] = useState(-1);
  const [editFormData, setEditFormData] = useState({});

  // Handle input changes during edit
  const handleEditChange = (e) => {
    const { name, value } = e.target;
    setEditFormData({ ...editFormData, [name]: value });
  };

  // Enable edit mode for a specific row
  const handleEditClick = (index) => {
    setEditIndex(index);
    setEditFormData(materials[index]);
  };

  // Save the edited row
  const handleSaveClick = () => {
    const updatedMaterials = [...materials];
    updatedMaterials[editIndex] = editFormData;
    setMaterials(updatedMaterials);
    setEditIndex(-1); // Exit edit mode
  };

  // Delete a row
  const handleDeleteClick = (index) => {
    const updatedMaterials = materials.filter((_, i) => i !== index);
    setMaterials(updatedMaterials);
  };

  return (
    <div className="table-container">
      <h2>Packaging Materials</h2>
      <table className="packaging-table">
        <thead>
          <tr>
            <th>Id</th>
            <th>Material</th>
            <th>Internal Measurements</th>
            <th>Weight Limit</th>
            <th>Description</th>
            <th>Last Modified</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {materials.map((material, index) => (
            <tr key={material.id}>
              {editIndex === index ? (
                <>
                  <td>{material.id}</td>
                  <td>
                    <input
                      type="text"
                      name="material"
                      value={editFormData.material}
                      onChange={handleEditChange}
                    />
                  </td>
                  <td>
                    <input
                      type="text"
                      name="internalMeasurement"
                      value={editFormData.internalMeasurement}
                      onChange={handleEditChange}
                    />
                  </td>
                  <td>
                    <input
                      type="text"
                      name="weightLimit"
                      value={editFormData.weightLimit}
                      onChange={handleEditChange}
                    />
                  </td>
                  <td>
                    <input
                      type="text"
                      name="description"
                      value={editFormData.description}
                      onChange={handleEditChange}
                    />
                  </td>
                  <td>{material.lastModified}</td>
                  <td>
                    <button onClick={handleSaveClick} className="save-btn">
                      Save
                    </button>
                  </td>
                </>
              ) : (
                <>
                  <td>{material.id}</td>
                  <td>{material.material}</td>
                  <td>{material.internalMeasurement}</td>
                  <td>{material.weightLimit}</td>
                  <td>{material.description}</td>
                  <td>{material.lastModified}</td>
                  <td>
                    <button
                      onClick={() => handleEditClick(index)}
                      className="edit-btn"
                    >
                      Edit
                    </button>
                    <button
                      onClick={() => handleDeleteClick(index)}
                      className="delete-btn"
                    >
                      Delete
                    </button>
                  </td>
                </>
              )}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Materials;
